import { Footer, Header } from "./components/index";

import './App.css';
import { AllRoutes } from "./routes/AllRoutes";

function App() {

  return (
      <div className="App">
        <Header />
        <main>
          <AllRoutes />
        </main>
        <Footer />
      </div>
  );
}

export default App;
